import Button from "./Button";
const Header = ({ title, onAdd, showAdd }) => {
  return (
    <header className="header">
      <h1>{title}</h1>
      <Button
        text={showAdd ? "Add Task" : "Close"}
        color="green"
        onClick={onAdd}
      />
    </header>
  );
};
export default Header;
